import React, { useState } from "react";
import { FaSwimmer, FaFutbol, FaBasketballBall, FaTableTennis, FaMapMarkerAlt, FaSearch } from "react-icons/fa";

const SearchBar = () => {
    // ... votre code existant ...

    return (
        <div className="bg-white p-3 rounded-md shadow-xl max-w-[280px] mx-auto">
            <h2 className="text-lg font-semibold mb-2 text-gray-800 text-center">Rechercher</h2>

            {/* Sélecteur d'activité */}
            <div className="mb-2">
                <label className="block text-sm font-medium mb-1">Activité</label>
                <div className="relative">
                    <button
                        onClick={() => setShowDropdown(!showDropdown)}
                        className="border p-2 pl-2 pr-4 rounded-md w-full text-left focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer flex items-center justify-between text-sm" // Padding réduit
                    >
                        {activity
                            ? activities.find((act) => act.value === activity).icon
                            : <FaSearch className="text-gray-400" />}
                        <span className="ml-1 text-xs">{activity ? activities.find((act) => act.value === activity).label : "Activité"}</span> {/* Taille de police réduite */}
                    </button>

                    {showDropdown && (
                        <ul className="absolute top-full left-0 w-full bg-white border rounded-md mt-1 shadow-md z-10 text-sm">
                            {activities.map((act) => (
                                <li
                                    key={act.value}
                                    onClick={() => {
                                        setActivity(act.value);
                                        setShowDropdown(false);
                                    }}
                                    className="p-2 flex items-center gap-2 cursor-pointer hover:bg-gray-100"
                                >
                                    {act.icon} <span className="text-xs">{act.label}</span> {/* Taille de police réduite */}
                                </li>
                            ))}
                        </ul>
                    )}
                </div>
            </div>

            {/* Sélecteur de localisation */}
            <div className="mb-2">
                <label className="block text-sm font-medium mb-1">Localisation</label>
                <div className="relative">
                    <button
                        onClick={() => setShowLocationDropdown(!showLocationDropdown)}
                        className="border p-2 pl-2 pr-4 rounded-md w-full text-left focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer flex items-center justify-between text-sm" // Padding réduit
                    >
                        {location
                            ? cities.find((city) => city.value === location).icon
                            : <FaMapMarkerAlt className="text-gray-400" />}
                        <span className="ml-1 text-xs">{location ? cities.find((city) => city.value === location).label : "Localisation"}</span> {/* Taille de police réduite */}
                    </button>

                    {showLocationDropdown && (
                        <ul className="absolute top-full left-0 w-full bg-white border rounded-md mt-1 shadow-md z-10 text-sm">
                            {cities.map((city) => (
                                <li
                                    key={city.value}
                                    onClick={() => {
                                        setLocation(city.value);
                                        setShowLocationDropdown(false);
                                    }}
                                    className="p-2 flex items-center gap-2 cursor-pointer hover:bg-gray-100"
                                >
                                    {city.icon} <span className="text-xs">{city.label}</span> {/* Taille de police réduite */}
                                </li>
                            ))}
                        </ul>
                    )}
                </div>
            </div>

            {/* Sélecteur de date */}
            <div className="mb-2">
                <label className="block text-sm font-medium mb-1">Date</label>
                <div className="relative">
                    <input
                        type="date"
                        value={date}
                        onChange={(e) => setDate(e.target.value)}
                        className="border p-2 pl-2 rounded-md w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer text-sm" // Padding réduit
                    />
                </div>
            </div>

            {/* Bouton de recherche */}
            <button
                onClick={handleSearch}
                className="bg-yellow-500 px-3 py-2 rounded-md hover:bg-yellow-400 transition-all duration-200 w-full flex items-center justify-center text-sm"
            >
                <FaSearch className="mr-2" /> Rechercher
            </button>
        </div>
    );
};

export default SearchBar;
